import React, { Component } from "react";

import UserService from "../services/user.service";
import { Router, Switch } from "react-router-dom";

export default class BoardAdmin extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  componentDidMount() {
    UserService.getAdminBoard().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response &&
              error.response.data &&
              error.response.data.message) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {
    return (
      <Router>
        
      <div className="navbar">
        <ul>
    <li><link className="link" to={"/add"}>
      Add Flight
    </link></li>
    <li><link className="link" to={"/delete"}>
      Delete Flight
    </link></li>
    <li><link className="link" to={"/update"}>
      Add Update
    </link>
    </li>
        </ul>
        
      </div>

      <Switch>
        <Route exact path="/add" Component={AddComponent}></Route>
        <Route exact path="/delete" Component={AddComponent}></Route>
        <Route exact path="/link" Component={AddComponent}></Route>
      </Switch>
      </Router>
    );
  }
}
